    "from sklearn.model_selection import TimeSeriesSplit\n",
    "from sklearn.model_selection import train_test_split\n",
    "from sklearn.model_selection import GridSearchCV\n",
    "from sklearn.preprocessing import StandardScaler\n",
    "from sklearn.pipeline import make_pipeline\n",
    "from sklearn.metrics import mean_squared_error\n",
    "\n",
    "\n",
    "\n",
    "def MLpipe_TSS_TTS_(X,y,preprocessor,ML_algo,param_grid):\n",
    "    '''\n",
    "    This function splits the data via Time Series Split with 5 folds to train and other, then runs train test split on the other data.\n",
    "    The MSE is minimized in cross-validation.\n",
    "    '''\n",
    "    \n",
    "    test_scores = []\n",
    "    best_models = []\n",
    "    val_scores = []\n",
    "\n",
    "    # loop through 10 random states\n",
    "    for i in range(10):\n",
    "        #define new random_state value\n",
    "        random_state = 12*i\n",
    "\n",
    "        ## apply Time Series Split\n",
    "        TSS = TimeSeriesSplit()\n",
    "        \n",
    "        \n",
    "        for train_ind, other_ind in TSS.split(X,y):\n",
    "            X_train = X.iloc[train_ind]\n",
    "            y_train = y.iloc[train_ind]\n",
    "            X_other = X.iloc[other_ind]\n",
    "            y_other = y.iloc[other_ind]\n",
    "        \n",
    "        # split other data into val/test 50/50 using train_test_split \n",
    "        X_val, X_test, y_val, y_test = train_test_split(X_other, y_other, test_size = 0.50, random_state = random_state, shuffle =True)\n",
    "        \n",
    "        # preprocess the data\n",
    "\n",
    "        ## first fitting preprocessor\n",
    "        preprocessor.fit(X_train)\n",
    "\n",
    "        ## then applying it to training set, validation set, and test set\n",
    "        X_train = preprocessor.transform(X_train)\n",
    "        X_val = preprocessor.transform(X_val)\n",
    "        X_test = preprocessor.transform(X_test)\n",
    "\n",
    "        # loop through the hyperparameter combinations or use GridSearchCV\n",
    "        \n",
    "        pipe = make_pipeline(ML_algo)\n",
    "        g = GridSearchCV(pipe, param_grid=param_grid, scoring = 'neg_root_mean_squared_error', cv = TSS, return_train_score = True, n_jobs = -1, verbose = False)\n",
    "        g.fit(X_train, y_train)\n",
    "        results = pd.DataFrame(g.cv_results_)\n",
    "\n",
    "        # for each combination, calculate the train and validation scores using the evaluation metric\n",
    "        train_score = g.score(X_train, y_train)\n",
    "        val_score = g.score(X_val, y_val)\n",
    "        \n",
    "        # find which hyperparameter combination gives the best validation score\n",
    "        model = g\n",
    "        \n",
    "        # calculate the test score\n",
    "        test_score = g.score(X_test, y_test)\n",
    "        \n",
    "        # append the test score and the best model to the lists\n",
    "        test_scores.append(test_score)\n",
    "        best_models.append(model)\n",
    "        \n",
    "    return best_models, test_scores\n",
    "\n",
    "import numpy as np\n",
    "#drop unneccesary columns, reverse X indices (so that the earliest datapoints are first) and drop NaN rows\n",
    "X = current_us.drop([\"hash\", \"lastModified\", \"dateChecked\", \"total\", \"posNeg\"], axis=1)\n",
    "X = X.iloc[::-1]\n",
    "X = X.dropna(axis=0)\n",
    "np.shape(X)\n",
    "\n",
    "#trim first week from y and last week from X so that we can predict y with X\n",
    "y = X[\"positive\"][7:].reset_index()\n",
    "y = y.drop(\"index\", axis=1)\n",
    "X_7 = X[len(X)-7:len(X)]\n",
    "X = X[0:len(X)-7].reset_index()\n",
    "X = X.drop(\"index\", axis=1)\n",
    "print(X)\n",
    "print(y)\n",
    "\n",
    "from sklearn.linear_model import Lasso\n",
    "preprocessor = StandardScaler()\n",
    "l1_param_grid = {'lasso__alpha': [1e-4, 1e-3, 1e-2, 1e-1, 1e0, 5,  1e1, 1e2]}\n",
    "l1_models, l1_scores = MLpipe_TSS_TTS_(X,y,preprocessor,Lasso(),l1_param_grid)\n",
    "print(np.mean(l1_scores))\n",
